/**
 * Hub Storage to assist in storing the filter to localStorage
 * and retrieving to populate back
 *
 * @returns {{persistFilters: persistFilters, populateFilters: populateFilters}}
 * @constructor
 */
function HubStorage() {

    /**
     * Returns the storage object if available, otherwise
     * a polyfill
     * @returns {*}
     */
    var getStorage = function () {
        if (window.localStorage) {
            return window.localStorage;
        }

        return {
            setItem: function () {},
            getItem: function () {}
        }
    };

    return {
        /**
         * Persist the fields matching the provided selector to local storage
         * @param selector
         */
        persistFilters: function (selector) {

        },

        /**
         * Populates the filters using the values stored in the localstorage
         * @param selector
         */
        populateFilters: function (selector) {

        },

        /**
         * Returns the localStorageObject
         * @returns {{setItem, getItem}}
         */
        getStorage: function () {
            return getStorage();
        }
    };
}

/**
 * 左侧资讯
 */
Vue.component('main-news',{
    template : `<div class="main-news bg-border"><el-tabs v-model="activeName" @tab-click="changeUrl">
                        <el-tab-pane label="热门资源" name="first" v-loading="downloadList.length==0">
                            <div class="crx_blog_list" v-for="item in downloadList">
                                <p><a class="crx_blog_t" :href="item.link" target="_blank">{{item.title}}</a></p>
                                <div class="crx_bott">
                                    <span class="download_fileType">{{item.filetype}}</span>
                                    <span class="pubDate">{{item.pubdate}}</span>
                                    <span class="source_size">大小：{{item.sourcesize}}</span>
                                </div>
                            </div>
                        </el-tab-pane>
                        <el-tab-pane label="最新博文" name="second" v-loading="blogList.length==0">
                            <div class="crx_blog_list" v-for="item in blogList">
                                <p><a class="crx_blog_t" :href="item.url" target="_blank">{{item.title}}</a></p>
                                <div class="crx_bott">
                                    <a class="blog_cat" :href="'https://www.csdn.net/nav/'+item.category_id" target="_blank">{{item.category}}</a>
                                    <a class="blog_nickname" :href="item.user_url" target="_blank">{{item.nickname}}</a>
                                    <span class="created_at">{{item.created_at}}</span>
                                    <span class="blog_views">{{item.views}}次阅读</span>
                                </div>
                            </div>
                        </el-tab-pane>
                     </el-tabs>                     
                        <a class="tab_more_a" :href="moreUrl" target="_blank">更多</a>
                     </div>`,
    data : function(){
        return {
            downloadList : [],
            blogList : [],
            chatList : [],
            activeList : [],
            moreList:['http://download.csdn.net/','http://blog.csdn.net/'],
            moreUrl:'http://download.csdn.net/',
            activeName: 'first'
        }
    },
    created: function () {
        var _this=this;
        axios.get('http://blog.csdn.net/api/articles', {
            params: {
                type: "more",
                category : "home",
                shown_offset : new Date().getTime()*1000
            }
        })
            .then(function (response) {
                _this.blogList=response.data.articles.slice(0,12);
            })
            .catch(function (error) {
                console.error(error);
            });
        axios.get('http://download.csdn.net/index.php/service/source/high_quality_sources', {
            params: {
                type: "more",
                category : "home",
                shown_offset : new Date().getTime()*1000
            }
        })
            .then(function (response) {
                _this.downloadList=response.data.hotsources.slice(0,11);
            })
            .catch(function (error) {
                console.error(error);
            });


    },
    methods : {
        changeUrl:function(tab){
            this.moreUrl =this.moreList[tab.index];
        }
    },
    computed : {
    },
    watch : {
    }
})


Vue.component('content-search',{
    template : `<div class="content-search bg-border">
                    <div class="searchWapper">
                        <el-input placeholder="搜索..." v-model="searchInput" class="input-with-select" @keyup.enter.native="submit()" :autofocus="true">
                            <el-select v-model="searchTypeActive" slot="prepend" placeholder="请选择">
                              <el-option v-for="item in searchList" :value="item.type" :label="item.name"></el-option>
                            </el-select>
                            <el-button slot="append" icon="el-icon-search" @click="submit()"></el-button>
                         </el-input>
                     </div>
                </div>`,
    // props : ['searchTypeActive'],
    data : function(){
        return {
            searchList : [{
                type : "bing",
                name : "Bing",
                logo : "logo",
                url : "https://www.bing.com/search?ensearch=1&q="
            },{
                type : "baidu",
                name : "Baidu",
                logo : "logo",
                url : "https://www.baidu.com/s?ie=UTF-8&wd="
            },{
                type : "google",
                name : "Google",
                logo : "logo",
                url : "https://www.google.com/search?q="
            }],
            searchInput : '',
            searchTypeActive : 'bing',
            input5: '',
            select: ''
        }
    },
    created: function () {
        this.searchTypeActive=hubStorage.getItem('searchType')||'bing';
    },
    methods : {
        submit : function () {
            window.open(this.searchActive.url+encodeURI(this.searchInput));
        }
    },
    computed : {
        searchActive : function(){
            return  this.searchList.find(item=>{
                return item.type==this.searchTypeActive;
            })
        }
    },
    watch : {
        searchTypeActive : function(newSearchType){
            hubStorage.setItem('searchType',newSearchType);
        }
    }
})





