/**
 * 判断CRX主页是否激活
 * @returns {boolean}
 */
function isActive(){
    // return false;
    if(window.location.hash.indexOf("normal")>-1){
        //URL后跟#normal的,必定跳转至NTP页
        return true;
    }
    //根据showNtp决定进入哪个页面
    var showNtp = hubStorage.getItem('isActive');
    if("false"==showNtp){
        return false;
    }
    return true;
}

var hubStorage;
(function(){
    hubStorage=new HubStorage().getStorage();
    if(!isActive()){
        chrome.tabs.update({
            url: 'chrome-search://local-ntp/local-ntp.html'
        });
        return;
    }
    var app=new Vue({
        el : '#app',
        data : {
            active : false,
            show : true,
            willShow:false
        },
        methods : {
            showTab:function(){
                if(this.willShow == false){
                    this.willShow = true;
                }else{
                    this.willShow = false;
                }
            }
        },
        created: function () {
            var isActive = "false"==hubStorage.getItem('isActive')?false:true;
            this.active=isActive;
        },
        watch : {
            active : function(available){
                hubStorage.setItem('isActive',available);
            }
        }
    })
})()



